import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const Nav = styled.nav`
  width: 100%;
  border: 1px solid white;
`;

const Menu = styled.menu`
  border: 1px solid aqua;
  width: 100%;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  & a {
    color: white;
  }
`;

const Brand = styled.div`
  width: 100px;
  > img {
    width: 100%;
  }
`

const Item = styled.div`
  white-space: nowrap;
  display: block;
  width: 100%;
  text-align: center;
  order: 2;
  display: none;
  & > a {
    padding: 1rem;
  }
`;

const Toggle = styled.div`
  order: 1;
`;


function Navbar() {
  return (
    <>
      <Nav>
        <Menu>
          <Brand>
            <Link href="/">
              <img src="/images/Logo.png" alt="my image" />
            </Link>
          </Brand>
          <Item>
            <Link href="/">
              <a>Home</a>
            </Link>
          </Item>
          <Item>
            <Link href="/about">
              <a>Skills</a>
            </Link>
          </Item>
          <Item>
            <Link href="/">
              <a>Posts</a>
            </Link>
          </Item>
          <Toggle><a href="#"><i className="fas fa-bars"></i></a></Toggle>
        </Menu>
      </Nav>
      {/* <Nav>
        <Brand>
          <img src="/images/Logo.png" alt="my image" />
        </Brand>

        <NavbarNav>
          <Link href="/">
            <a>Home</a>
          </Link>
          <Link href="/about">
            <a>About</a>
          </Link>
        </NavbarNav>
      </Nav> */}
    </>
  )
}

export default Navbar
